import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const Index = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        style={{
          borderRadius: "5px",
          width: "310px",
          height: "440px",
          backgroundColor: "#F7F7F7",
          padding: "20px",
          margin: "80px",
        }}
      >
        <Typography
          style={{ color: "333333", textAlign: "center", fontSize: "30px " }}
        >
          Sign in{" "}
        </Typography>
        <Box style={{ padding: "10px" }}>
          <Button
            style={{
                margin:"5px",
              width: "100%",
              margin: "0px",
              backgroundColor: "#337AB7",
              color: "#FFFFFF",
            }}
            variant="contained"
            color="#337AB7"
          >
            Sign in with . <strong>facebook</strong>
          </Button>
          <Button
            style={{
              width: "100%",
              margin: "0px",
              backgroundColor: "#5BC0DE",
              color: "#FFFFFF",
            }}
            variant="contained"
            color="#337AB7"
          >
            Sign in with . <strong> Twitter</strong>
          </Button>
        </Box>
      </Box>
    </div>
  );
};
export default Index;
